import React,{ Component } from 'react';
import './App.css';
import {Router, Link} from '@reach/router';
import About from './Components/About';
import LandingPage from './Components/Landing';
import { Timeline, TimelineItem }  from 'vertical-timeline-component-for-react';


function App() {
  return (
    <div className="App">
    <Link to='/About'>About</Link>
    <Link to='/Projects'>Projects</Link>
    <Link to='/Contact'>Contact</Link>
    <Timeline lineColor={'#ddd'}>
  <TimelineItem
    key="001"
    dateText="03/2020 – Present"
    dateInnerStyle={{ background: '#D4B5F2', color: '#000' }}
    style={{ color: '#D4B5F2' }}
  >
    <h3>Full Stack Software Development Student</h3>
    <h4>Coding Dojo, Chicago, IL</h4>
    <p>Have spent the past few months immersing myself 60+ hours a week learning and solidying programming languages and concepts through the rigorous Coding Dojo curriculum. Have demonstrated mastery of MERN and Python thus far, achieving the highest accolade in both languages. Have also gained in-depth understanding of constructing algorithms and different data structures. Also demonstrated understanding of HTML and CSS.

    </p>
  </TimelineItem>
  <TimelineItem
    key="002"
    dateText="08/2019 – 03/2020"
    dateInnerStyle={{ background: '#A678D4', color: '#000' }}
    bodyContainerStyle={{
      background: '#ddd',
      padding: '20px',
      borderRadius: '8px',
      boxShadow: '0.5rem 0.5rem 2rem 0 rgba(0, 0, 0, 0.2)',
    }}
  >
    <h3 style={{ color: '#A678D4' }}>Clinical Research Coordinator</h3>
    <h4 style={{ color: '#A678D4' }}>Lurie Children's Hospital, Chicago, IL</h4>
    <p>
      Worked with principal investigators in gastroenterology to facilitate their clinical research in rare diseases. Helped with the maintenance and collection of data, and saw firsthand how heavily the medical industry and research relied on technology to push change. 
    </p>
  </TimelineItem>
  <TimelineItem
    key="003"
    dateComponent={(
      <div
        style={{
          display: 'block',
          float: 'left',
          padding: '10px',
          background: 'rgb(150, 150, 150)',
          color: '#fff',
        }}
      >
        09/2015 – 06/2019
      </div>
    )}
  >
    <h3>Achieved Bachelor's Degree</h3>
    <h4>Northwestern University, Evanston, IL</h4>
    <p>
      Graduated from Northwestern University with a Bachelor of Arts in Environmental Science on the pre-health track. Throughout my four years, I  cultivated powerul critical thinking skills which I attribute to a liberal arts degree, as well as strong basis in mathematics and science. Took relevant courses such as Calculus 3, Chemistry, Physics, and Statistics. More importantly, I gained soft skills such as effective communication, leadership, teamwork, accounability, and a love and desire for life-long learning. 
    </p>
  </TimelineItem>

</Timeline>

    <Router>
      <LandingPage path='/'/>
      <About path='/About'/>

    </Router> 




    </div>
  );
}

export default App;
